      "fullText" : "Giving fledgling devs prescriptive, \"tried and true recipes\" seems to commonly stunt their growth. It happened to me, it happened to people I tutored, and it happened to many others. If the skill to learn is problem solving, it is destructive to pronounce 75% of problems solved.",
