      "fullText" : "WebAssembly is one of the last \"mainstream\" 32-bit architectures left in an otherwise very 64-bit world, so besides being able to address &gt;4GB, being able to uniformly use 64-bit pointers &amp; data types across all platforms you target will be a nice simplification for many systems.",
